import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate the search input and fill it with 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate and click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    // There are multiple buttons with this class, we'll click the first one associated with the main search bar.
    await page.locator('.search-btn').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // 3. Extract the value from the search input to verify the action
    const searchInputValue = await page.locator('#searchInput').inputValue();

    return {
      success: true,
      action: "Searched for 'iPhone' products",
      extractedData: {
        searchQuery: searchInputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for products",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
